 --select 'insert into road_station_sensor(id, natural_id, name, obsolete, obsolete_date, lotju_id, description, name_fi, short_name_fi,
 -- unit, accuracy, road_station_type) values (' || id || ',' || natural_id || ',''' || name || ''',' || case when obsolete = 0 then 'false' else 'true' end || ',' || case when obsolete_date is null then 'null' else '''' || to_char(obsolete_date, 'yyyy-mm-dd hh24:mm:ss') || '''' end || ',' || lotju_id || ',''' || description || ''',''' || name_fi || ''',''' || short_name_fi || ''',''' || unit || ''',' || case when accuracy is null then 'null' else '' || accuracy end || ',''' || road_station_type || ''');' from road_station_sensor;


alter sequence seq_road_station_sensor restart with 442;